import React, { Component } from 'react';
import ResultsAPI from "../../API/ResultsAPI";

class RecentResults extends Component<any,any> {
    constructor(props: any) {
        super(props);
        this.state = {
            recentinfo: [],
        };
    }

    async componentDidMount() {
        const resultApi: ResultsAPI = new ResultsAPI()
        const recentinfo: any[] = await resultApi.Recent();
        this.setState({ recentinfo });
    }
    render() {
        const membersToRender = this.state.recentinfo.filter()
        const numRows = membersToRender.length
        console.log(this.state.recentinfo)
        console.log(numRows.length)
        console.log("Sliced", this.state.recentinfo.slice(0, this.state.recentinfo.length - 1))

        return (
            <div className={"flex flex-raw justify-center h-[50%] w-[70%] p-10 "}>
                {this.state.recentinfo.slice(0, this.state.recentinfo.length - 1 ).map((elem: any, key:number)=>(
                    <div key={key}>
                        {elem.number}
                        {elem.constructor}
                        {elem.driver}
                        {elem.points}
                        {elem.position}
                        {elem.status}
                    </div>
                ))}
            </div>
        );
    }
}

export default RecentResults;
